import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

class Header extends Component {
    state = {
        liens: [{
            random: {
                root: 'random',
                title: 'Random'
            },
            categories: {
                root: '',
                title: 'Categories'
            }
        }]
    }
    render() {
        return(
            <header>
                <nav>
                    {this.state.liens.map(lien => {
                        console.log(lien.root);
                    })}
                </nav>
            </header>
        )
    }
}

export default Header;
